  <style>
    html {
      scroll-behavior: smooth;
    }

    body {
      font-family: 'Syne', sans-serif;
    }

    container {
      width: 100%;
      padding-right: 15px;
      padding-left: 15px;
      margin-right: auto;
      margin-left: auto;
    }

    .container {
      display: flex;
    }

    .image-container {
      text-align: center;
      width: 100%;
    }

    .links-container {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      gap: 20px;
    }

    .text-container {
      display: grid;
      flex-direction: column;
      align-items: start;
      gap: 5px;
      grid-template-columns: 1fr 1fr;
      vertical-align: top;
    }

    footer {
      border-style: solid;
      border-width: 2px;
    }

    .footer {
      border-style: solid;
      border-width: 2px;
      padding-bottom: 310px;
    }

    .footer1 {
      border-style: solid;
      border-width: 2px;
      padding-bottom: 90px;
    }

    body {
      margin: 0;
      display: flex;
      flex-direction: column;
      min-height: 100vh;
      background-color: #111111;
    }

    .navbar {
      width: 85%;
      margin: auto;
      padding: 35px 0;
      display: flex;
      align-items: center;
      justify-content: space-between;
    }

    .center {
      display: block;
      margin-left: auto;
      margin-right: auto;
      width: 10%;
    }

    .overlay {
      opacity: 0.8;
      background-color: #ccc;
      position: fixed;
      width: 100%;
      height: 100%;
      top: 0px;
      left: 0px;
      z-index: 1000;
    }

    .logo-wrapper {
      display: flex;
      align-items: center;
      justify-content: center;
      flex-direction: column;
      margin-top: 13%;
    }

    img+button {
      float: right;
    }

    button {
      width: 180px;
      margin-left: 25%;
      margin-right: 25%;
      padding: 15px 0;
      text-align: center;
      margin: 20px 10px;
      border-radius: 25px;
      font-weight: bold;
      border: 1px solid rgb(255, 255, 255, .2);
      background: transparent;
      color: white;
      cursor: pointer;
      position: relative;
      overflow: hidden;
      transition-duration: 0.3s;
    }

    button:hover {
      color: var(--ubg) !important;
      text-decoration: none;
      background-color: lightgrey;
    }

    .text-box {
      margin-left: 44vw;
      margin-top: 42vh;
    }

    button:link,
    button:hover {
      transform: translateY(-3px);
      box-shadow: 0 10px 20px white);
    }

    button:active {
      transform: translateY(-1px);
      box-shadow: 0 5px 10px rgba(0, 0, 0, 0.2);
    }

    .btn-white {
      background-color: #fff;
      color: #777;
    }

    button::after {
      content: "";
      display: inline-block;
      height: 100%;
      width: 100%;
      border-radius: 100px;
      position: absolute;
      top: 0;
      left: 0;
      z-index: -1;
      transition: all 0.4s;
    }

    .btn-white::after {
      background-color: #fff;
    }

    button:hover::after {
      transform: scaleX(1.4) scaleY(1.6);
      opacity: 0;
    }

    .btn-animated {
      -webkit-animation: moveInBottom 5s ease-out;
      animation: moveInBottom 5s ease-out;
      -webkit-animation-fill-mode: backwards;
      animation-fill-mode: backwards;
    }

    @-webkit-keyframes moveInBottom {
      0% {
        opacity: 0;
        transform: translateY(30px);
      }

      100% {
        opacity: 1;
        transform: translateY(0px);
      }
    }

    @keyframes moveInBottom {
      0% {
        opacity: 0;
        transform: translateY(30px);
      }

      100% {
        opacity: 1;
        transform: translateY(0px);
      }
    }

    .filter {
      width: 180px;
      margin-left: 25%;
      margin-right: 25%;
      padding: 15px 0;
      text-align: center;
      margin: 20px 10px;
      border-radius: 25px;
      font-weight: bold;
      border: 4px solid rgb(255, 255, 255, .2);
      background: transparent;
      color: white;
      cursor: pointer;
      position: relative;
      overflow: hidden;
    }

    .logo {
      width: 150px;
    }

    .logo-wrapper .text {
      font-size: 75px;
      font-family: "Roboto";
      color: #FFFFFF;
    }

    .main-input-button {
      padding: 10px;
      background: none;
      margin-left: 1px;
      margin-right: 1px;
      outline: none;
      margin-top: 2px;
      color: white;
      border: #fff solid 3px;
      border-radius: 3px;
      cursor: pointer;
      transition: 0.25s ease;
      z-index: 10;
      position: relative;
    }

    .exploits {
      display: flex;
      columns: auto auto;
      padding: 20px;
      column-gap: 25px;
      margin-top: 0;
      flex-wrap: wrap;
      height: 50%;
      justify-content: center;
    }

    footer a {
      cursor: pointer;
    }

    footer a:hover {
      text-decoration: underline;
    }

    form {
      display: flex;
      justify-content: center;
    }

    form input {
      background: none;
      font-family: inherit;
      padding: 0px 17px;
      height: 48px;
      border: 1px solid rgb(255, 255, 255, .2);
      color: var(--text-color);
      border-radius: 3px;
      outline: none;
      width: 350px;
      margin-top: 5px;
      border-radius: 50px;
      color: #FFFFFF;
    }

    #gifs-rows img {
      cursor: pointer;
    }

    #gifs-rows .gif-file {
      display: none;
    }
  </style>

  </style>
